# /user agents to $TMP/.ua
	_userAgent () {
		cd $TMP
		clear
		echo -e ""$ww_" Simulate your real or random device. \e[00m\n1)"$ww_" Mannualy \e[00m\n2)"$ww_" Automatic \e[00m"
		[[ -f $HOME/twm/.UA && -s $HOME/twm/.UA ]] && {
			UA=$(cat $HOME/twm/.UA)
		} || {
			read -p "Set up User-Agent[1 to 2]: " -t 300 -e -n 1 UA
		}
		case $UA in

			(0) clear; echo "0" >$HOME/twm/.UA
			[[ ! -e $TMP/.ua || -z $UA ]] && {
				echo "" | base64 -d | sed 's/"//g' >$TMP/.ua
			} ;;

			(1) clear; echo "0" >$HOME/twm/.UA; xdg-open $(echo "aHR0cHM6Ly93d3cud2hhdHNteXVhLmluZm8=" | base64 -d) ; read -p "Copy and paste your User Agent here and tip ENTER: " -t 900 -e -n 250 UA && echo "$UA" >$TMP/.ua
			[[ ! -e $TMP/.ua || -z $UA ]] && {
				echo "" | base64 -d | sed 's/"//g' >$TMP/.ua
			} ;;

			(2) echo "" | base64 -d | sed 's/"//g' >$TMP/.ua
			echo "2" >$HOME/twm/.UA ; echo -e ""$pp_"" ; echo "Automatic User Agent selected" ; echo -e "\e[00m" ;;

			(*) clear; [[ -n $UA ]] && echo -e "\n Invalid option: $(echo $UA)" && kill -9 $$ || echo -e "\n Time exceeded!" ;;
		esac
		unset UA
	}
	[[ ! -e $TMP/.ua || $(cat $TMP/.ua | wc -c) -lt 10 || $(cat $TMP/.ua | wc -c) -gt 65 ]] && {
		_userAgent
